import M from "materialize-css";
import TopBar from '../Components/TopBar'


class Home extends Component {

    componentDidMount(){
        M.AutoInit()
    }

    render() {
        return(
        <div>
            <TopBar/>
        <div className="carousel">
    <a className="carousel-item" href="#one!">
        <img src="https://covers.openlibrary.org/w/id/8595949-M.jpg" width="500px" height="100px"/></a>
    <a className="carousel-item" href="#two!">
        <img src="https://covers.openlibrary.org/w/id/7424001-M.jpg" /></a>
    <a className="carousel-item" href="#three!">
        <img src="https://lorempixel.com/250/250/nature/3" /></a>
    <a className="carousel-item" href="#four!">
        <img src="https://lorempixel.com/250/250/nature/4" /></a>
    <a className="carousel-item" href="#five!">
        <img src="https://lorempixel.com/250/250/nature/5" /></a>
    </div>
        </div>
        )
    }
}

export default Home;
